  let history = useHistory();

  const onHome = () =>{
    history.push("/");


  };

  const onLogin = ()=>{
    history.push("/login");

  };

  const onSignUp =()=>{
      history.push("/signup");
  };


  const { Header } = Layout;

  return(
   <>
    <Layout>
      <Header className="header">
        <div className="logo" />
