          <Menu.Item key="1" onClick ={onHome}>Home</Menu.Item>
          <Menu.Item key="2" onClick ={onLogOut}>LogOut</Menu.Item>
        </Menu>

      </Header>

    </Layout>

</>
  );

};
export default TopBar;
